import React from 'react';
import data from './Assets/data.json'
import BlogCard from './BlogCard';



const Home = ({ logged }) => {
  return (
    <>
      <div id='homeContainer'>
        <h1>Welcome to Blogs  </h1>
        <div id='blogsList'>
          {data.map((val) => { return (<BlogCard val={val} logged={logged} key={val.id} />) })}
        </div>
      </div>
    </>
  )
}

export default Home
